import React from "react";
import { useSelector } from "react-redux";
import "../styles/table.css";

function Table() {
    const notebooks = useSelector((state) => state.dataReducer.notebooks);
    const parameters = useSelector((state) => state.dataReducer.parameters);

    const selectRow = (target) => {
        console.log(target);
    };

    return (
        <div className="table-wrap">
            <table cellPadding="15" cellSpacing="0" className="table-notebooks">
                <thead>
                    <tr className="first-row">
                        <th></th>
                        {parameters.map((parameter) => (
                            <th className="title-column" key={parameter}>
                                {parameter}
                            </th>
                        ))}
                    </tr>
                </thead>
                <tbody>
                    {notebooks.map((notebook, index) => (
                        <tr
                            className="row"
                            key={index}
                            onClick={(e) => selectRow(e.target)}
                        >
                            <th key={index + 1}>{notebook.name}</th>
                            <td key={index + 2}>{notebook.resolution}</td>
                            <td key={index + 3}>{notebook.year}</td>
                            <td key={index + 4}>{notebook.memory}</td>
                            <td key={index + 5}>{notebook.screen}</td>
                            <td key={index + 6}>{notebook.RAM}</td>
                            <td key={index + 7}>{notebook.disk}</td>
                            <td key={index + 8}>{notebook["CPU frequency"]}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default Table;
